import React from "react"
import { Navbar } from 'flowbite-react';

const Navigation = () => {
    return(
        <>
            <Navbar
                fluid={true}
                rounded={false}
                style={{backgroundColor: '#152A46'}}
            >
                <div className="container flex flex-wrap items-center justify-between mx-auto">
                    <span className="self-center text-xl font-semibold whitespace-nowrap dark:text-white text-white">LOGO</span>
                    <Navbar.Toggle />
                    <Navbar.Collapse>
                        <ul className="flex flex-col p-4 mt-4 border border-gray-100 rounded-lg bg-gray-50 md:flex-row md:space-x-8 md:mt-0 md:text-sm md:font-medium md:border-0" style={{backgroundColor: '#152A46'}}>
                            <li>
                                <span className="text-white">Beranda</span>
                            </li>
                            <li>
                                <span className="text-white">Tentang Kami</span>
                            </li>
                        </ul>
                    </Navbar.Collapse>
                </div>
            </Navbar>
        </>
    );
}

export default Navigation
